import React,{useState,useEffect} from "react";
import AUTH_ROUTES, {RenderRoutes} from "./components/Route/AUTH_ROUTES";
import {BrowserRouter} from "react-router-dom";
import {Route, Switch} from "react-router-dom";
import "./Styles/App.css"
import AppBar from "./components/MainPage/AppBar";
import Signup from "./components/auth/signup/Signup";
import Login from "./components/auth/login/Login";
import Home from "./components/MainPage/Home/Home";
import Club from "./components/MainPage/Club/Club";

function App() {
    const [isAuth, setIsAuth] = useState(false);

    useEffect(() => {
    }, []);

    

    return (
        <BrowserRouter>
                <div className="App" >
                    {isAuth ? <Route component={AppBar}/>: null}
                    <Switch>
                        <Route
                            path={"/"}
                            exact={true}
                            component={() => <Login setIsAuth = {setIsAuth}/>}
                        />
                        {/*<Route*/}
                        {/*    path={"/login"}*/}
                        {/*    exact={true}*/}
                        {/*    component={Login(isAuth)}*/}
                        {/*/>*/}
                        <Route
                            path={"/signup"}
                            exact={true}
                            component={Signup}
                        />
                        <Route
                            path={"/home"}
                            exact={true}
                            component={Home}
                        />
                        <Route
                            path={"/club"}
                            exact={true}
                            component={Club}
                        />
                    </Switch>
                </div>
        </BrowserRouter>
    );
}

export default App;
